               function updpopUsers(){
               var list = document.getElementById('upduserlist');
               removeOptions(list);
               var users = new Array()
               return firebase.database().ref('users').once('value').then(function(snapshot) {
                  snapshot.forEach(function(childSnapshot) {
                     var data = childSnapshot;
                     users.push([data.val().info.name,data.val().info.uid])
                     });
        users.sort(function(a, b) { 
                  return a[0] > b[0] ? 1 : -1;
               });
               var df = document.createDocumentFragment();
               for (var i = 0; i<users.length; i++){
                  var option = document.createElement('option');
                     option.value = users[i][1];
                     option.appendChild(document.createTextNode(users[i][0]));
                     df.appendChild(option);
               }
               list.appendChild(df)
                  });
            }
	     
	     				       		   function openTTab(event, divName) {
  var i, x, tablinks;
    var x = document.getElementsByClassName("trip");
    for (i = 0; i < x.length; i++) {
       x[i].style.display = "none";  
    }
	tablinks = document.getElementsByClassName("ttablink");
  for (i = 0; i < x.length; i++) {
      tablinks[i].className = tablinks[i].className.replace(" w3-green", "");
  }
    document.getElementById(divName).style.display = "block"; 
    event.currentTarget.className += " w3-green";
}
            
